import React, { Component } from 'react';
import './App.css';
class Nbres_de_pas extends Component{
    render(){
        return(
 <div className="Nbres_de_pas">
              <h1>Nombres de Pas aujourd'hui</h1>
              <div className="Pas-today">
                <h5>6000</h5>
              </div>
              <div className="Pas-hier">
                <h6>Hier : 4000</h6>
              </div>
            </div>
      );
    }



}
export default Nbres_de_pas;
